cy.fixture('stores').then(stores => {
  stores.forEach(store => {
    cy.visit(store, {
      failOnStatusCode: false
    }, {
      responseTimeout: 10000
    }, {
      followRedirect: true
    });
    cy.acceptCookies();
    cy.customLogin().listingApiCalls().commonApiInterception();
    // Continue with the checkout process
    cy.fixture('shippingInfo.json').then(shippingInfo => {
      cy.addShippingAddress();
      cy.addProductToBasket();
      cy.productSizer();
      cy.basketValidation();
      cy.selectShippingMethod(store);
      // Set the altValue based on the store
      let altValue = '';
      if (store.includes(shippingInfo.FRANCE.storeUrl)) {
        altValue = 'Virement Bancaire';
      } else if (store.includes(shippingInfo.SPAIN.fullUrl) || store.includes(shippingInfo.ITALY.fullUrl)) {
        cy.wrap(store).should(storeValue => {
          expect(storeValue).to.include.oneOf([shippingInfo.SPAIN.fullUrl, shippingInfo.ITALY.fullUrl]);
        });
        altValue = 'Transferencia bancaria';
      } else {
        throw new Error('Invalid country URL.');
      }
      // SEPA payment method
      cy.get('body').then(payment => {
        let sepaPayment;
        cy.validateElement('.c-payment-method-item__wrapper > :nth-child(2) > :nth-child(1) > .c-payment-method-item__button');
        cy.get('.c-payment-method-item__wrapper > :nth-child(2) > :nth-child(1) > .c-payment-method-item__button').click({
          force: true
        }).get(`[alt='${altValue}']`).then(sepaPaymentMethod => {
          sepaPayment = sepaPaymentMethod;
          if (payment.find(sepaPayment).length > 0) {
            sepaPayment.trigger("click");
          } else {
            throw new Error('SEPA payment method is either not activated for this test OR something went wrong');
          }
        });
      });
    });
    // Validate this payment method and pay
    cy.validateElement('[data-cy="submit-basket"]');
    cy.get('[data-cy="submit-basket"]').click({
      force: true
    });
    // Successful payment validation
    cy.validateElement('.c-confirm__header', {
      timeout: 20000
    }).validateElement('.c-confirm__title').validateElement('.c-confirm__subtitle');
  });
});
